package main

import "fmt"

func lengthOfLongestSubstring(s string) int {
	var longest int
	m := make(map[uint8]int)
	i, j := 0, 0
	for i < len(s) && j < len(s) {
		if _, ok := m[s[j]]; ok {
			if longest < j-i {
				longest = j - i
			}
			nowi := m[s[j]]
			for k := i; k <= nowi; k++ {
				delete(m, s[k])
			}
			i = nowi + 1
		} else {
			m[s[j]] = j
			j++
			if longest < j-i {
				longest = j - i
			}
		}
	}

	return longest
}

